import "./TopBar.css";
import logoImage1 from "../Obrazky/obrazok1.jpg";
import logoImage2 from "../Obrazky/obrazok2.jpg";

import { useState } from "react";


const TopBar = () => {

    const[Image,setImage] = useState(logoImage1);

    const changeImage = () => {
        if(imageCounter === 0){
            setImage(logoImage2)
            imageCounter = 1;
        }
        if(imageCounter === 1){
            setImage(logoImage1)
            imageCounter = 0;
        }
}

    return(
        <div>
            <button onClick={changeImage}>DREAM CRUISE</button>
            <img src={Image} alt="Logo" />
        </div>

    )
}

export default TopBar;

